import React, {useState} from 'react'
import './index.css'

function Bulb (props) {
  const [adjective, setAdjective] = useState("hungry")
  function makeAdjective(){
    let newAdjective = "fun"
    if (adjective === "fun") newAdjective = "hungry"
    setAdjective(newAdjective)
  }

  return (
    <div>
      <img src="./light_off.jpg" className="jasper" />
      <p>
        my dog is {adjective} {props.mood}
      </p>
      <p>
        {props.address}
      </p>
      <button onClick={makeAdjective}>
        click me
      </button>
    </div>
  )
}

export default Bulb
